op-opacity:1" />\n                                <stop offset="100%" style="stop-color:rgb(18, 161, 46);stop-opacity:1" />\n                        </linearGradient>\n                    </defs>\n                    <rect fill="url(#grad1)"\n                        x="10" y="10" width="100" height="100"/>\n                </svg>\n            </div>     \n        <span> <b>100% </b></span>\n        </div>\n        <h4>Diff Report</h4>\n        The colour in the Diff Report depends on the ratio of the sample minimum to the sample maxium. \n        Result sets where the sample minimum and the sample maximum are identical will be coloured in the main\n        <span style="color: rgb(42, 123, 184)"> <b> blue </b> </span> \n        colour of the memote colour scheme. Result sets where the sample minimum is very small relative to the sample maximum will appear\n        <span style="color: rgb(161, 18, 18)"> <b> red </b> </span>. \n        This ratio is calculated with the following formula:\n        <br>\n        <b> 1 - (Min / Max)) * 100 </b>\n        This is then mapped to the following gradient:\n        <div fxLayoutAlign=\'center center\'>\n            <span> <b>Identical</b></span>\n            <div style="display: inline-block; vertical-align: middle">\n                <svg width="120" height="60">\n                    <defs>\n                        <linearGradient id="grad2">\n                        <stop offset="0%" style="stop-color:rgb(42, 123, 184);stop-opacity:1" />\n                        <stop offset="100%" style="stop-color:rgb(161, 18, 18);stop-opacity:1" />\n                        </linearGradient>\n                    </defs>\n                    <rect fill="url(#grad2)"\n                        x="10" y="10" width="100" height="100"/>\n                </svg>\n            </div>     \n        <span> <b>Different</b></span>\n        </div>\n    </mat-card-content>\n    </mat-card>\n    <mat-card>\n        <mat-card-title>Why are the tests divided into two principal sections?</mat-card-title>\n        <mat-card-content>\n    <p>The tests in the left section are independent of the class of modeled organism, the complexity of a genome-scale metabolic model (GSM) or the types of identifiers\n         that are used to describe its components. Because of this, it is possible to calculate a score for these tests which further allows for the quick comparison of GSMs. The unscored section on ther right \n         provides general statistics and covers specific aspects of a metabolic network that are not universally applicable. For instance,\n           dedicated quality control of the biomass equation only applies to GSM which are used to investigate cell growth.</p>\n        </mat-card-content>\n    </mat-card>\n    <mat-card>\n            <mat-card-title>"Reconstructions" versus "Models"</mat-card-title>\n            <mat-card-content>\n        <p>The variety of constraints-based modeling approaches and the fundamental differences between various organisms compound the assessment of GSMs. For\n                instance, some authors may publish metabolic networks which are parameterized, ready to run flux balance analysis (FBA), these are referred to simply as \'models\'. Alternatively,\n                 others may publish unconstrained metabolic databases (referred to as \'reconstructions\'), from which several models can be derived by applying differential constraints. Both can be encoded in SBML. \n                 With having an independent scored test section, we attempt to make both \'models\' and \'reconstructions\' comparable, although a user should be aware that this difference exists and is subject to <a href="https://github.com/opencobra/memote/issues/228"> some discussion </a>.\n                Please note, that some tests in the specific section may error for a reconstruction as they require initialization.</p>\n            </mat-card-content>\n        </mat-card>\n    <mat-card>\n    <mat-card-title>How is the score calculated?</mat-card-title>\n    <mat-card-content>\n    <p>Each test in the independent section provides a relative measure of completeness with regard to the tested property. The final score is the weighted sum of all individual test\n         results normalized by the maximally achievable score i.e. all individual results at 100%. Individual tests can be weighted, but it is also possible to apply weighting to entire test \n         categories. Hence the final score is calculated:</p>\n         <br>\n         \x3c!-- Generated with this latex formula \\[ TotalScore = \\frac{\\sum_{Sections} weight_{section} \\times ( \\sum_{Tests} weight_{test} \\times score_{test})}{MaxScore}\\] at http://www.tlhiv.org/ltxpreview/ --\x3e\n         <svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 310 23">\n            <defs>\n              <symbol id="a" overflow="visible">\n                <path d="M4.25-6.05c.08-.28.1-.34.23-.37.1-.02.43-.02.63-.02 1.01 0 1.45.03 1.45.82 0 .15-.03.54-.08.8l-.03.18c0 .06.03.14.13.14s.12-.08.15-.23L7-6.47c.02-.05.02-.14.02-.17 0-.11-.1-.11-.27-.11H1.22c-.24 0-.25.02-.33.2L.3-4.8c0 .02-.06.16-.06.2 0 .04.07.1.13.1.1 0 .1-.06.17-.22.53-1.55.8-1.72 2.27-1.72h.39c.28 0 .28.03.28.13 0 .04-.03.17-.05.2L2.1-.78C2-.42 1.97-.31.91-.31c-.36 0-.43 0-.43.18C.48 0 .6 0 .66 0l.8-.02.87-.01.83.01.86.02c.09 0 .21 0 .21-.2 0-.11-.07-.11-.34-.11-.23 0-.37 0-.62-.02-.3-.03-.38-.06-.38-.22 0-.01 0-.06.05-.2zm0 0"/>\n              </symbol>\n              <symbol id="b" overflow="visible">\n                <path d="M4.67-2.72c0-1.05-.69-1.69-1.6-1.69C1.76-4.4.42-2.98.42-1.58.4-.59 1.08.11 2 .11c1.33 0 2.67-1.38 2.67-2.83zM2.02-.1c-.44 0-.88-.31-.88-1.1 0-.48.27-1.56.58-2.06.5-.76 1.08-.92 1.36-.92.58 0 .87.49.87 1.08 0 .4-.2 1.44-.58 2.08-.35.58-.9.92-1.35.92zm0 0"/>\n              </symbol>\n              <symbol id="c" overflow="visible">\n                <path d="M2.05-3.98h.93c.2 0 .32 0 .32-.2 0-.12-.11
